import React from 'react';
import Header from './components/Header';
import Footer from './components/Footer';
import MemberList from './components/MemberList';

const ClubManagePage = () => {
    return (
        <>
        <Header />
        <br></br>
        <br></br>
        <MemberList/>
        <br></br>
        <br></br>
        <Footer />
        </>
    );
};

export default ClubManagePage;
